(()=>{const e=$("#trailer_id"),a=$("#driver_id"),r=$("#seller_id"),l=$("#carrier_id");e.select2({placeholder:"Select",ajax:{url:"/trailer/selection",data:e=>({search:e.term,page:e.page||1,take:15})}}),a.select2({placeholder:"Select",ajax:{url:"/driver/selection",data:e=>({search:e.term,page:e.page||1,take:15,carrier:l.val(),noTruck:1})}}),r.select2({placeholder:"Select",ajax:{url:"/user/selection",data:e=>({search:e.term,page:e.page||1,take:15,type:"seller"})}}),l.select2({ajax:{url:"/carrier/selection",data:e=>({search:e.term,page:e.page||1,take:15})},placeholder:"Select",allowClear:!0})})();
